import EditableTable from '../components/table/EditableTable';

function JobTable(props) {
  // console.log(props.result);
  return (
    <>
      <EditableTable
        showSearch="none"
        showIcon="none"
        jobTitleT="Job Title"
        jobTitle="title"
        jobLocationT="Job Location"
        jobLocation="location"
        location1="New York"
        location2="London"
        startDateT="Start Date"
        startDate="Sdate"
        endDateT="End Date"
        endDate="Edate"
        statusT="Status"
        status="status"
        onSearch={props.onSearch}
        dataSource={props.dataSource}
        result={props.result}
      />
    </>
  );
}

export default JobTable;
